// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AdminDashboard {
    struct User {
        string name;
        string email;
        string role;
    }

    struct PatientRecord {
        string patientName;
        string diagnosis;
        string prescription;
        uint256 timestamp;
    }

    struct LabBooking {
        string testName;
        string userEmail;
        uint256 timestamp;
    }

    mapping(address => User) public users;
    PatientRecord[] public patientRecords;
    LabBooking[] public labBookings;

    event UserAdded(address indexed userAddress, string name, string email, string role);
    event PatientRecordAdded(string patientName, string diagnosis, string prescription);
    event LabBookingAdded(string testName, string userEmail);

    function addUser(string memory _name, string memory _email, string memory _role) public {
        users[msg.sender] = User(_name, _email, _role);
        emit UserAdded(msg.sender, _name, _email, _role);
    }

    function addPatientRecord(string memory _patientName, string memory _diagnosis, string memory _prescription) public {
        patientRecords.push(PatientRecord(_patientName, _diagnosis, _prescription, block.timestamp));
        emit PatientRecordAdded(_patientName, _diagnosis, _prescription);
    }

    function addLabBooking(string memory _testName, string memory _userEmail) public {
        labBookings.push(LabBooking(_testName, _userEmail, block.timestamp));
        emit LabBookingAdded(_testName, _userEmail);
    }

    function getPatientRecords() public view returns (PatientRecord[] memory) {
        return patientRecords;
    }

    function getLabBookings() public view returns (LabBooking[] memory) {
        return labBookings;
    }
}

contracts/AppointmentBooking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AppointmentBooking {
    struct Appointment {
        string name;
        string email;
        string phone;
        string doctor;
        string date;
        string time;
        bool booked;
    }

    mapping(uint256 => Appointment) public appointments;
    uint256 public appointmentCount;

    event AppointmentBooked(uint256 id, string name, string doctor, string date, string time);
    event AppointmentCancelled(uint256 id);

    function bookAppointment(
        string memory _name,
        string memory _email,
        string memory _phone,
        string memory _doctor,
        string memory _date,
        string memory _time
    ) public {
        appointmentCount++;
        appointments[appointmentCount] = Appointment(_name, _email, _phone, _doctor, _date, _time, true);
        emit AppointmentBooked(appointmentCount, _name, _doctor, _date, _time);
    }

    function cancelAppointment(uint256 _id) public {
        require(appointments[_id].booked, "Appointment not found");
        appointments[_id].booked = false;
        emit AppointmentCancelled(_id);
    }

    function getAppointment(uint256 _id) public view returns (Appointment memory) {
        return appointments[_id];
    }
}

contracts/AuthContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AuthContract {
    struct User {
        string email;
        bytes32 passwordHash;
        string userType;
    }

    mapping(address => User) private users;
    mapping(string => address) private emailToAddress;

    event UserRegistered(address indexed userAddress, string email, string userType);
    event UserAuthenticated(address indexed userAddress, string email);

    function registerUser(string memory _email, string memory _password, string memory _userType) public {
        require(emailToAddress[_email] == address(0), "Email already registered");

        bytes32 passwordHash = keccak256(abi.encodePacked(_password));
        users[msg.sender] = User(_email, passwordHash, _userType);
        emailToAddress[_email] = msg.sender;

        emit UserRegistered(msg.sender, _email, _userType);
    }

    function authenticateUser(string memory _email, string memory _password) public view returns (bool) {
        address userAddress = emailToAddress[_email];
        require(userAddress != address(0), "User not found");

        User memory user = users[userAddress];
        return user.passwordHash == keccak256(abi.encodePacked(_password));
    }
}

